import React, { useState } from 'react';

/**
 * Filter bar for the Formate page. Allows users to refine the
 * displayed events by target audience, event type, theme, location
 * and date. Calls the provided onFilterChange callback with the
 * updated filter state when the form is submitted.
 */
const FilterBar = ({ onFilterChange }) => {
  const [categories, setCategories] = useState({
    Kinder: true,
    Jugendliche: false,
    Erwachsene: false,
    Inklusion: false,
    Umsonst: false,
  });
  const [eventType, setEventType] = useState('beides');
  const [theme, setTheme] = useState('');
  const [place, setPlace] = useState('');
  const [date, setDate] = useState('');

  const handleCategoryToggle = (key) => {
    setCategories((prev) => {
      const updated = { ...prev, [key]: !prev[key] };
      return updated;
    });
  };

  const themes = [
    'Sport & Action',
    'Essen & Trinken',
    'Baby & Familie',
    'Natur & Tiere',
    'Spielen & Probieren',
    'Kunst & Kreativität',
    'Musik & Gesang',
    'Begegnung & Party',
    'Tanz & Darstellung',
    'Theater & Kino',
    'Ausstellungen & Medien',
    'Kultur & Sprache',
    'Religion & Spiritualität',
    'Politik & Einsatz',
    'Vielfalt & Akzeptanz',
    'Bunt & Queer',
    'FLINTA & Community',
    'Frauen & Stärke',
    'Flucht & Migration',
    'Antirassismus & Empowerment',
    'Beratung & Bildung',
    'Netzwerk & Selbsthilfe',
  ];

  const places = [
    'Teehaus Moabit',
    'Öffentliche Bibliothek',
    'Markthalle Moabit',
  ];

  const handleSubmit = (e) => {
    e.preventDefault();
    onFilterChange && onFilterChange({ categories, eventType, theme, place, date });
  };

  return (
    <form className="bg-white shadow-md p-4 rounded mb-6" onSubmit={handleSubmit}>
      <div className="flex flex-wrap items-center gap-4">
        <div className="flex items-center flex-wrap">
          <span className="mr-2 font-medium">Angebote für:</span>
          {Object.keys(categories).map((key) => (
            <label key={key} className="mr-3 flex items-center space-x-1 text-sm">
              <input
                type="checkbox"
                checked={categories[key]}
                onChange={() => handleCategoryToggle(key)}
              />
              <span>{key}{key === 'Inklusion' ? '*' : ''}</span>
            </label>
          ))}
        </div>
        <div className="flex items-center">
          <span className="mr-2 font-medium">Art:</span>
          <select
            value={eventType}
            onChange={(e) => setEventType(e.target.value)}
            className="border rounded px-2 py-1"
          >
            <option value="beides">beides</option>
            <option value="einmalig">einmalig</option>
            <option value="regelmaessig">regelmäßig</option>
          </select>
        </div>
        <div>
          <label className="mr-2 font-medium">Thema:</label>
          <select
            value={theme}
            onChange={(e) => setTheme(e.target.value)}
            className="border rounded px-2 py-1"
          >
            <option value="">Alle</option>
            {themes.map((th) => (
              <option key={th} value={th}>
                {th}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label className="mr-2 font-medium">Ort:</label>
          <select
            value={place}
            onChange={(e) => setPlace(e.target.value)}
            className="border rounded px-2 py-1"
          >
            <option value="">Alle</option>
            {places.map((p) => (
              <option key={p} value={p}>
                {p}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label className="mr-2 font-medium">Datum:</label>
          <input
            type="date"
            value={date}
            onChange={(e) => setDate(e.target.value)}
            className="border rounded px-2 py-1"
          />
        </div>
        <button type="submit" className="btn ml-auto">
          OK
        </button>
      </div>
    </form>
  );
};

export default FilterBar;
